import "./header.css";

import { Carousel } from "react-responsive-carousel";
import "react-responsive-carousel/lib/styles/carousel.min.css";
const images = [
  "https://media.istockphoto.com/photos/blogging-woman-reading-blog-picture-id887987150?k=6&m=887987150&s=612x612&w=0&h=LNwDiO847vPnFnrTWLvaoessy-Uf3hctFxa1SpyEyNU=",
  "https://www.ionos.com/digitalguide/fileadmin/DigitalGuide/Teaser/blog-t.jpg",
  "https://www.ionos.com/digitalguide/fileadmin/DigitalGuide/Teaser/blog-t.jpg"
];
export default function Header() {
  return (
    <div className="header">
      <div className="headerTitles">
        <span className="headerTitleLg">Blog Website</span>
      </div>
      <div className="headerImg">
      <Carousel useKeyboardArrows={true} className="headerImg">
        {images.map((URL) => (
          <div className="headerImg">
            <img alt="sample_file" src={URL} />
          </div>
        ))}
      </Carousel>
      </div>
    </div>
  );
}
